        oval.addCurve(to: CGPoint(x: 4, y: 8), controlPoint1: CGPoint(x: 0, y: 6.21), controlPoint2: CGPoint(x: 1.79, y: 8))
        oval.close()
        context.saveGState()
        context.translateBy(x: 6, y: 8)
        oval.lineWidth = 2
        UIColor.white.setStroke()
        oval.stroke()
        context.restoreGState()
        
        /// Rectangle
        let rectangle3 = UIBezierPath()
