        rectangle3.addLine(to: CGPoint(x: 0, y: 2))
        rectangle3.addLine(to: CGPoint.zero)
        rectangle3.close()
        context.saveGState()
        context.translateBy(x: 3, y: 0)
        rectangle3.usesEvenOddFillRule = true
        UIColor.white.setFill()
        rectangle3.fill()
